import React from 'react';
import '../App.css';
//import useForm from './LoginFormHandler';

const LoginForm = () => {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    const handleChangeEmail = ({target}) => 
    setEmail(target.value);

    const handleChangePassword = ({target}) => 
    setEmail(target.value);
    

    return (
      <div className="main-container col-md-12">
        <div className="container col-md-8">
        <form onSubmit class="align-items-sm-center  ">
          <div class="col-md-3">
            <label for="inputEmail4" class="form-label">Email</label>
            <input type="email" value={email} onChange={handleChangeEmail} class="form-control" id="inputEmail4" />
          </div>
          <div class="col-md-3">
            <label for="inputPassword4" class="form-label">Password</label>
            <input type="password" value={password} onChange={handleChangePassword}  class="form-control" id="inputPassword4" />
           </div>
           <br />
          <div class="col-12">
            <button type="submit" class="btn btn-primary">Sign in</button>
          </div>
        </form>
      </div>
      </div>

    )
}
export default LoginForm;
